import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 2a1 1 0 000 2v4.5A2.5 2.5 0 005.5 11h2v2h-2a.5.5 0 000 1h5a.5.5 0 000-1h-2v-2h2A2.5 2.5 0 0013 8.5V4a1 1 0 100-2H3z", fill: primaryFill }));
};
const ProjectionScreen16Filled = wrapIcon(rawSvg({}), 'ProjectionScreen16Filled');
export default ProjectionScreen16Filled;
